import { useState } from "react";

export default function App() {
  return (
    <div className="App">
      <Step />
      <Counter />
      <Dates />
    </div>
  );
}

function Step() {
  return (
    <>
      <div className="step">
        <button>-</button>
        <p>Step:1</p>
        <button>+</button>
      </div>
    </>
  );
}
function Counter() {
  return (
    <>
      <div className="counter">
        <button>-</button>
        <p>Counter:1</p>
        <button>+</button>
      </div>
    </>
  );
}
function Dates() {
  let [num, setNum] = useState(0);
  // const currDate = new Date().toLocaleDateString();
  const currDate = new Date().toString();
  return (
    <>
      <div className="date">
        <p>
          {num} days from today is {currDate}
        </p>
      </div>
    </>
  );
}
